import React, { useContext } from 'react';
import LogContext from '../ContextAPI/LogsAPI/LogContext';

const Techlist = () => {
    const context = useContext(LogContext);
    const { techs } = context;
    return (
        <div className='modal' id='tech-list'>
            <div className='modal-content'>
                <div className='row'>
                    <h4 className='left'>Technicians :</h4>
                </div>

                {techs &&
                    techs.map(tech => (
                        <li key={tech._id} tech={tech}>
                            <i className='material-icons left'>face</i>
                            <strong
                                className='left'
                                style={{
                                    fontWeight: 'bolder',
                                    display: 'grid'
                                }}
                            >
                                <a href='#!'>
                                    {' '}
                                    {tech.firstName + ' ' + tech.lastName}
                                </a>
                            </strong>
                            <a href='#!' className='secondary-content'>
                                <i className='material-icons grey-text'>
                                    delete
                                </i>
                            </a>
                            <br />
                        </li>
                    ))}
            </div>
        </div>
    );
};

export default Techlist;
